DROP TABLE IF EXISTS `deep_sky_object`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `deep_sky_object` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(17) NOT NULL COMMENT 'Object name, usually the NGC number is in field #1, but for objects with no NGC value the alphabetical name used is listed in table catalog_code',
  `other_name` varchar(18) DEFAULT NULL,
  `object_type` varchar(5) DEFAULT NULL,
  `constellation` varchar(3) DEFAULT NULL,
  `RAh` int(11) DEFAULT NULL,
  `RAm` double DEFAULT NULL,
  `DEd` int(11) DEFAULT NULL,
  `DEm` double DEFAULT NULL,
  `magnitude` double DEFAULT NULL,
  `surface_brigthness` double DEFAULT NULL,
  `u2k_chart` int(11) DEFAULT NULL COMMENT 'The charts in the first release of Uranometria 2000.0 that map the area of sky in which the object is located',
  `ti_chart` int(11) DEFAULT NULL COMMENT 'The charts in the Tirion Sky Atlas 2000.0 that map the area of sky in which the object is located',
  `size_max` double DEFAULT NULL COMMENT 'The large dimension of the object',
  `size_max_unit` enum('d','m','s') DEFAULT NULL,
  `size_min` double DEFAULT NULL COMMENT 'The small dimension of the object',
  `size_min_unit` enum('m','s') DEFAULT NULL,
  `position_angle` double DEFAULT NULL COMMENT 'The Position Angle of an elongated object.  The value is in degrees, starting with north as zero degrees and progressing clockwise from north',
  `class` varchar(11) DEFAULT NULL COMMENT 'Several professional classification schemes are contained here',
  `stars_count` int(11) DEFAULT NULL COMMENT 'Number of stars within a cluster',
  `brightest_star_mag` double DEFAULT NULL COMMENT 'Magnitude of brightest star in cluster or central star of planetary nebula',
  `in_bestngc_catalog` tinyint(1) DEFAULT NULL COMMENT 'Is this object included in Best NGC catalog',
  `in_caldwell_catalog` tinyint(1) DEFAULT NULL COMMENT 'Is this object included in Calwell catalog',
  `in_herschel_catalog` tinyint(1) DEFAULT NULL COMMENT 'Is this object included in Herschel catalog',
  `in_messier_catalog` tinyint(1) DEFAULT NULL COMMENT 'Is this object included in Messier catalog',
  `ngc_desc` varchar(55) DEFAULT NULL COMMENT 'Visual description of the object.  Most of these are from the NGC. See table ngc_desc_abbreviation',
  `notes` varchar(86) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `constellation` (`constellation`),
  CONSTRAINT `deep_sky_object_ibfk_1` FOREIGN KEY (`constellation`) REFERENCES `constellation` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=10343 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

